INSERT INTO `wp_commentmeta` VALUES (237087, 82332, 'akismet_as_submitted', 'a:54:{s:15:"comment_post_ID";s:5:"16738";s:14:"comment_author";s:19:"burberry scarf sale";s:20:"comment_author_email";s:17:"ngljsyc@gmail.com";s:18:"comment_author_url";s:49:"http://www.grss-ieee.org/burberry-703online-shop/";s:15:"comment_content";s:6589:"<br>The couple had dated briefly before Doherty embarked on his relationship with Moss. The on again-off again relationship seems finally to be over, with Kate also with new man Jamie Hince.</p>﻿<p> proved just how far she&#039;s come since joining the Royal Family by joining children from inner-city on a camping trip in Kent. <br><br>It seems like the has had a whirlwind year of learning the royal ropes but now is more than confident to undertake solo public engagements.<br><br><br><br>This weekend saw Kate dressed in casual gear, including &pound;300 Le Chameau wellies, Zara jeans and jumper, a Burberry shirt and waterproof waistcoat from Really Wild, as she got stuck in on the countryside visit. <br><br>Kate watched the children take part in different outdoor activities such as building a shelter, campfire building and outdoor cooking.<br><br><br><br>Duchess Kate clearly didn&#039;t mind getting her hands dirty as she crawled into the makeshift tents and happily sat in the mud as she chatted to the pupils. <br><br>Ceasing their opportunity, the kids took the chance to ask Kate what it&#039;s really like to be a member of the Royal Family. Tigerlily Smith, 8, who spoke to Kate revealed: &#039;She said she got to visit lots of countries but hadn&rsquo;t seen as many as William. She said William was very sweet and kind and spoiled her.&rsquo;<br><br>The trip to Widehorizons Margaret McMillan House in Wrotham, Kent was organised by ARK Schools, with the aim of helping children from underprivileged backgrounds to develop their confidence and teamwork skills in the countryside.<br><br>Kate had a busy weekend with not only her camping trip but an appearance at the and a day out at the Beaufort Polo Club.<br><br>What do you think of &#039;s casual attire? And what do you make of her &pound;300 wellies? Let us know in the comment box below...<br><p></p><p></p><p></p><p>Watch the and the rest of the Royal Family during the balcony appearance at Trooping the Colour...</p><p><p><p><p><p><p><p><p><p></p></p>﻿<p> joined a gaggle of girl pals to attend the prestigious Cartier Queen&#039;s Cup Polo tournament over the weekend - but was nowhere to be seen. <p></p><p>The blonde beauty, who split with the Prince back in 2010, arrived to watch the prestigious Cartier Queen&#039;s Cup Polo at the at Guards Polo Club in Windsor with a group of friends. </p><p>Dressing for summer, chose a pretty blue summer dress and snakeskin wedges heels and Rayban sunnies for the posh outing.</p><p>But , who reportedly still holds a candle for his South African ex-girlfriend, was nowhere to be seen. </p><p>Instead the Prince was on royal duty, attending Trooping the Colour in London, with , , and the rest of the Royal Family. </p><p>Royal ex mingled with a host of celebs in the exclusive enclosure at the polo club. </p><p>Also in attendance were Dita Von Teese, Burberry boy Douglas both, Kaya Scodelario and Elliott Tittensor, and Made in Chelsea star Hugo Taylor. </p><p>He may not have been in attendance on the day, but still managed to get his polo fix during the weekend. </p><p>Harry joined , and their new puppy Lupo at a charity match at Beaufort Polo club on Sunday. <br></p><p>Would you like to see and reunite? Let us know in the comments box below... <br></p><p></p><p></p><p></p><p></p></p>﻿<p>It&#039;s been almost a year since was a regular on the red carpet, but the British beauty was back with a bang in London last night at the premiere of new movie A Dangerous Method.<p></p><p>Scoring serious style points for her red carpet ensemble, the starlet dared to bare in a sweeping backless Burberry gown, which showed off her tiny frame. </p><p>Treating snappers to her trademark smouldering stare, completed her premiere look with a sultry smokey eye, gentle marcel waves and a slick of pretty pink to highlight her bee-stung pout. </p><p>The actress was joined on the red carpet by co-stars Michael Fassbender and Viggo Mortesson to debut the David-Cronenberg flick.</p><p>And afterwards the trio hit a swanky premiere afterparty, where they were joined by Keira&#039;s new beau, rocker James Righton. <br></p><p>Speaking of her racy new film role - in which she plays the lover and patient of psycho-analyst Carl Jung - Keira revealed she &#039;almost turned it down&#039; after reading some of film&#039;s saucier scenes. </p><p>&#039;I did think about turning it down because of the two scenes of a sadomasochistic nature and I thought it&#039;s all going to come out and all of a sudden it&#039;s all going to all be about that,&#039; she explained. </p><p>&#039;And weirdly, apart from this country, it hasn&#039;t been, so that&#039;s been really great.</p><p>&#039;In England it&#039;s got mentioned all the time. I don&#039;t know what that says about us! We obviously like spanking, I don&#039;t know.&#039;</p><p>Right then. </p><p>Love premiere look? Let us know in the comments box below&hellip; </p><p></p><p></p></p>﻿<p> pulled off her most fashionable look to date last night, as she rubbed shoulders with the cream of the British fashion industry at a glitzy gala in London. <br><br>The 23-year-old wore a pale pink long-sleeved dress with royal blue (natch) cuffs by London-based designer Roksanda Illincic to walk the red carpet as the guest of honour at the Britain Creates 2012: Fashion &amp; Art Collusion VIP event held at the Old Selfridges Hotel. The princess&#039; accessories were all by UK-based designers too, including a pair of blue patterned Nicholas Kirkwood pumps and an sparkly pink clutch by Anya Hindmarch. <br><br><br><br> wasn&#039;t the only one to pull off a stylish gala look. Singer wowed onlookers in a dramatic black gown with sexy sheer layers and twinkling embellishment from Julien Macdonald&#039;s yet-to-be-seen autumn/winter 2012 collection, while fellow songstress Eliza Doolittle and Holly Valance also wore their party best. <br><br>A whole host of leading fashion designers were also in attendance at the gala to celebrate the series of works commissioned for the London Festival 2012, including Burberry&#039;s Creative Director Christopher Baiely, Giles Deacon, Maria Grachvogel, Jonathan Saunders, Bally&#039;s Graeme Fidler and Michael Herz, and milliner Stephen Jones. <br><br>Britain Creates 2012: Fashion &amp; Art Collusion will be on display at London&#039;s Victoria &amp; Albert Museum from 6th July. <br><br><br><br><br><br><br></p>﻿<p>, who, as fifth in line to the throne, must be used to being waited on herself, has landed a new job - as a shop assistant at Selfridges.<br>";s:12:"comment_type";s:0:"";s:14:"comment_parent";s:1:"0";s:7:"user_ID";s:1:"0";s:7:"user_ip";s:13:"218.66.71.210";s:10:"user_agent";s:113:"Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1; Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1) )";s:8:"referrer";s:88:"http://stuyspectator.com/2012/02/27/the-dangers-of-star-power/penny-wars-by-sora-kim-bw/";s:4:"blog";s:24:"http://stuyspectator.com";s:9:"blog_lang";s:5:"en_US";s:12:"blog_charset";s:5:"UTF-8";s:9:"permalink";s:88:"http://stuyspectator.com/2012/02/27/the-dangers-of-star-power/penny-wars-by-sora-kim-bw/";s:21:"akismet_comment_nonce";s:6:"passed";s:20:"POST_comment_post_ID";s:5:"16738";s:19:"POST_comment_parent";s:1:"0";s:26:"POST_akismet_comment_nonce";s:10:"b10b9aff84";s:11:"POST_submit";s:14:"Submit Comment";s:11:"POST_author";s:19:"burberry scarf sale";s:10:"POST_email";s:17:"ngljsyc@gmail.com";s:8:"POST_url";s:49:"http://www.grss-ieee.org/burberry-703online-shop/";s:12:"POST_comment";s:6589:"<br>The couple had dated briefly before Doherty embarked on his relationship with Moss. The on again-off a