INSERT INTO `wp_commentmeta` VALUES (237905, 82595, 'akismet_as_submitted', 'a:54:{s:15:"comment_post_ID";s:5:"16744";s:14:"comment_author";s:16:"longchamp outlet";s:20:"comment_author_email";s:19:"halrhlcuy@gmail.com";s:18:"comment_author_url";s:48:"http://www.croshalgroup.com/703-longchamp-outlet";s:15:"comment_content";s:1194:"<p>By now, fans have already heard Chris Mann&rsquo;s big voice. He was prominently featured in early NBC sneak peeks. The Wichita singer whose mother is currently fighting pancreatic cancer won over both Cee Lo and Christina with the operatic &ldquo;Because We Believe.&rdquo; Surprisingly, Cee Lo was the first to turn his chair. Christina did so moments later. She would later say that he was definitely &ldquo;The Voice.&rdquo; And Cee Lo would call it &ldquo;exceptionally beautiful.&rdquo; Blake just admitted he didn&rsquo;t understand a word of the performance. Um, yeah, Blake, it was in another language. Chris explained how he has tried to shrink his voice down to fit what others wanted it to be. While Cee Lo stressed that he was the first to turn around, Christina may have won him over by telling him she knows what to do with real vocalists. So, to Christina he went while the camera captured Cee Lo&rsquo;s shock over the decision. I would say that either choice has its advantages. Christina likes to give a pop makeover to her team members, while I think Cee Lo would work to make Chris&rsquo; performances as big as his voice. We&rsquo;ll see how that works out for him.</p>";s:12:"comment_type";s:0:"";s:14:"comment_parent";s:1:"0";s:7:"user_ID";s:1:"0";s:7:"user_ip";s:14:"121.204.88.236";s:10:"user_agent";s:50:"Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1)";s:8:"referrer";s:101:"http://stuyspectator.com/2012/02/27/the-dangers-of-star-power/girls-gymnastics-by-victoria-stempel-2/";s:4:"blog";s:24:"http://stuyspectator.com";s:9:"blog_lang";s:5:"en_US";s:12:"blog_charset";s:5:"UTF-8";s:9:"permalink";s:101:"http://stuyspectator.com/2012/02/27/the-dangers-of-star-power/girls-gymnastics-by-victoria-stempel-2/";s:21:"akismet_comment_nonce";s:6:"passed";s:20:"POST_comment_post_ID";s:5:"16744";s:19:"POST_comment_parent";s:1:"0";s:26:"POST_akismet_comment_nonce";s:10:"49db101dba";s:11:"POST_submit";s:14:"Submit Comment";s:11:"POST_author";s:16:"longchamp outlet";s:10:"POST_email";s:19:"halrhlcuy@gmail.com";s:8:"POST_url";s:48:"http://www.croshalgroup.com/703-longchamp-outlet";s:12:"POST_comment";s:1194:"<p>By now, fans have already heard Chris Mann&rsquo;s big voice. He was prominently featured in early NBC sneak peeks. The Wichita singer whose mother is currently fighting pancreatic cancer won over both Cee Lo and Christina with the operatic &ldquo;Because We Believe.&rdquo; Surprisingly, Cee Lo was the first to turn his chair. Christina did so moments later. She would later say that he was definitely &ldquo;The Voice.&rdquo; And Cee Lo would call it &ldquo;exceptionally beautiful.&rdquo; Blake just admitted he didn&rsquo;t understand a word of the performance. Um, yeah, Blake, it was in another language. Chris explained how he has tried to shrink his voice down to fit what others wanted it to be. While Cee Lo stressed that he was the first to turn around, Christina may have won him over by telling him she knows what to do with real vocalists. So, to Christina he went while the camera captured Cee Lo&rsquo;s shock over the decision. I would say that either choice has its advantages. Christina likes to give a pop makeover to her team members, while I think Cee Lo would work to make Chris&rsquo; performances as big as his voice. We&rsquo;ll see how that works out for him.</p>";s:15:"SERVER_SOFTWARE";s:9:"LiteSpeed";s:11:"REQUEST_URI";s:21:"/wp-comments-post.php";s:11:"HTTP_ACCEPT";s:87:"image/gif, image/x-xbitmap, image/jpeg, image/pjpeg, application/x-shockwave-flash, */*";s:20:"HTTP_ACCEPT_ENCODING";s:13:"gzip, deflate";s:15:"HTTP_CONNECTION";s:5:"Close";s:12:"CONTENT_TYPE";s:33:"application/x-www-form-